import React, { useEffect, useState, useRef } from "react";
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Avatar from '@mui/material/Avatar';
import ButtonGroup from '@mui/material/ButtonGroup';
import { Link } from "react-router-dom";
import ButtonAppBar from '../Component/Nav';
import Axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import Modal from '@mui/material/Modal';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Stack from '@mui/material/Stack';
import { Select, MenuItem } from '@mui/material';


export  function DashboardIn() {
  const [users, setUsers] = useState([]);
  const [sresult, setsResult] = useState('');
  const [result, setResult] = useState('');
  const [searchinput, setSearchinput] = useState('');
  const [searchinput2, setSearchinput2] = useState('');
  const [severityLevel, setseverityLevel] = useState('');
  const history = useNavigate();
  useEffect(() => {
    UsersGet()
    //console.log(profile);
  }, [])
  const [options, setOptions] = useState([]);
  useEffect(() => {

    async function fetchSuggestions() {

      //if (searchinput !== "") {
        //console.log("useeffect");
        const response = await Axios.get(`http://localhost:3001/api/druglist`);
        setOptions(response.data);
        //console.log(response);
      //}
    }

    fetchSuggestions();
  }, [searchinput]);
  const [formData, setFormData] = useState({
    dname1: '',
    dname2: '',
    description: '',
    level: '',
  });
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [textareaValue, setTextareaValue] = useState("");
  const textareaRef = useRef(null);

  const handleTextareaChange = (event) => {
    setTextareaValue(event.target.value);
  };
  const handleSeverityLevelChange = (event) => {
    setseverityLevel(event.target.value);
  };
  const handleAddButtonClick = () => {
    setIsModalOpen(true);
  };
  const handleClose = () => {
    setIsModalOpen(false);
  };
  const handleSubmit = () => {
    console.log(searchinput);
    console.log(searchinput2);
    console.log(severityLevel);
    console.log(textareaValue);

  };
  const handleChangeDrug1 = (event, value) => {
    const name = 'dname1';
    console.log(value);
    setFormData({ ...formData, [name]: value }); // update form data
  }
  const handleChangeDrug2 = (event, value) => {
    const name = 'dname2';
    console.log(value);
    setFormData({ ...formData, [name]: value }); // update form data
  }
  const UsersGet = () => {
    Axios.get("http://localhost:3001/api/topInteract")
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  };

  const UpdateUser = id => {
    console.log("rid" + id);
    const link = '/updateInteract/'+id;
    //history('/updateSuggest/${id}');
    history(link);
  }

  const UserDelete = id => {
    Axios.post('http://localhost:3001/api/deleteInteract', {
      'rid' : id,
    }).then((respond) => {
      console.log(respond.data);
      setsResult(respond.data);
      console.log(id);
      Swal.fire({
        icon: "success",
        title: "Success",
        text: result.message,
      });
      UsersGet();
    }).catch((error) => {
      console.error(error);
      Swal.fire({
        icon: "error",
        title: "Error",
        text: result.message,
      });
    });
  }

  return (
    <div>
      <ButtonAppBar />
      <Container sx={{ p: 2 }} maxWidth="lg">
        <Paper sx={{ p: 2 }}>
          <Box display="flex">
            <Box flexGrow={1}>
              <Typography component="h2" variant="h6" color="primary" gutterBottom>
                Interaction
              </Typography>
            </Box>
            <Box>
              <Button variant="contained" color="primary" onClick={handleAddButtonClick}>
                Add
              </Button>
            </Box>
          </Box>
          <TableContainer component={Paper}>
            <Table aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell align="right">ID</TableCell>
                  <TableCell align="center">Drug Name</TableCell>
                  <TableCell align="left">Drug Name</TableCell>
                  {/* <TableCell align="left">Last</TableCell> */}
                  <TableCell align="center">Severity level</TableCell>
                  <TableCell align="center">Modification</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {users.map((user) => (
                  <TableRow key={user.DDi_id}>
                    <TableCell align="right">{user.DDi_id}</TableCell>
                    {/* <TableCell align="center">
                      <Box display="flex" justifyContent="center">
                        <Avatar src={user.avatar} />
                      </Box>
                    </TableCell> */}
                    <TableCell align="center">{user.drug1}</TableCell>
                    <TableCell align="left">{user.drug2}</TableCell>
                    <TableCell align="center">{user.level}</TableCell>
                    <TableCell align="center">
                      <ButtonGroup color="primary" aria-label="outlined primary button group">
                        <Button onClick={() => UpdateUser(user.rid)}>Edit</Button>
                        <Button onClick={() => UserDelete(user.rid)}>Del</Button>
                      </ButtonGroup>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Paper>
      </Container>
      <Modal
        open={isModalOpen}
        onClose={() => setIsModalOpen(false)}
        aria-labelledby="add-interaction-modal-title"
        aria-describedby="add-interaction-modal-description"
      >
        <Box sx={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', width: 800, height: 400, bgcolor: 'background.paper', boxShadow: 24, p: 4 }}>
          <Typography id="add-interaction-modal-title" variant="h6" component="h2" gutterBottom>
            Add Interaction
          </Typography>
          {/* Add your form elements here */}
          {/* <Stack spacing={2} sx={{ width: 400 }} className="me-4">
            <Autocomplete
                    freeSolo
                    id="free-solo-2-demo"
                    disableClearable
                    options={options.map((option) => option.name)}
                    getOptionLabel={(option) => option.toString()}
                    value={searchinput}
                    onChange={handleChangeDrug1}
                    renderInput={(params) => (
                    <TextField
                        {...params}
                        label="Search Drug"
                        InputProps={{
                        ...params.InputProps,
                        type: 'search',

                        }}
                        value= {searchinput}
                    />
                    )}
                />
            </Stack>
            <Stack spacing={2} sx={{ width: 400 }} className="me-4">
            <Autocomplete
                    freeSolo
                    id="free-solo-2-demo"
                    disableClearable
                    options={options.map((option) => option.name)}
                    getOptionLabel={(option) => option.toString()}
                    value={searchinput2}
                    onChange={handleChangeDrug2}
                    renderInput={(params) => (
                    <TextField
                        {...params}
                        label="Search Drug"
